import java.io.*;
import java.util.*;
class  Main {
    static Scanner sc = new Scanner(System.in);
    static StringBuilder sb = new StringBuilder();
    public static void main(String [] args){
            int n  = sc.nextInt();
            long m = sc.nextLong();
            int [] treeHeights = new int[n];
            for(int i = 0 ; i < n;i++){
                treeHeights[i] =sc.nextInt();
            }
            int left= 0 ;
            int right = 1000000000;
            int result =-1;
            while(left < right){
                int mid = (left + right)/2;
                long sum = countNumberOfCuttingTrees(treeHeights,mid, m);
                if(sum >= m){
                    result = Math.max(result,mid);
                  left= mid+1;
                }else{
                    right = mid;
                }
            }
            System.out.println(result);

    }
    public static  long  countNumberOfCuttingTrees(int [] treeHeights, int mid, long m){
       long sum = 0;
        for(int i = 0 ; i < treeHeights.length;i++){
            if(treeHeights[i] > mid){
                if(treeHeights[i] -  mid <= m){
                    sum += treeHeights[i] -  mid;
                }
            }
        }
        return sum;
    }
}
